_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1534858","type":"CustomJS"},{"attributes":{"dimensions":"width"},"id":"1534523","type":"PanTool"},{"attributes":{"below":[{"id":"1534555"}],"center":[{"id":"1534558"},{"id":"1534562"},{"id":"1534616"}],"height":110,"left":[{"id":"1534559"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1534584"},{"id":"1534590"},{"id":"1534600"},{"id":"1534622"},{"id":"1534645"},{"id":"1534670"}],"sizing_mode":"stretch_width","title":{"id":"1534602"},"toolbar":{"id":"1534571"},"toolbar_location":null,"width":null,"x_range":{"id":"1534506"},"x_scale":{"id":"1534551"},"y_range":{"id":"1534549"},"y_scale":{"id":"1534553"}},"id":"1534547","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"group":null},"id":"1534889","type":"Title"},{"attributes":{"source":{"id":"1534540"}},"id":"1534818","type":"CDSView"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1534710","type":"WheelZoomTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1534539"},"glyph":{"id":"1534587"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1534589"},"nonselection_glyph":{"id":"1534588"},"view":{"id":"1534591"}},"id":"1534590","type":"GlyphRenderer"},{"attributes":{},"id":"1534610","type":"Selection"},{"attributes":{"axis":{"id":"1534705"},"coordinates":null,"
